import os

def isprime(n):

    if n < 2: return False
    for i in range(2, n):
        if n % i == 0:
            return False
    return True

def isfile():

    for i in range(200):
        path = str(i) + '.in'
        if os.path.isfile(path) == False:
            f = open(path, 'w')
            f.close()
            return isprime(i + 1)




print('Pee' if isfile() else 'Mee')
